import {SIGNUP_ACTION} from "@/store/storeconstants";

export default {
    [SIGNUP_ACTION](context, payload){
        console.log('Signup action called');
        console.log(context, payload);
        axios.post('http://127.0.0.1:8000/register')
    }
};
